import React from 'react';
import { IColumnProps } from '../types/types';
import Basemap from './Map';

const Column = (props: IColumnProps) => {

    const {
        style,
    } = props

    return (
        <>
            <div
                className='col-sm-4'
                style={style}
            >
                <Basemap />
            </div>
        </>
    )
}

export default Column;
